import Button from '@restart/ui/esm/Button';
import React from 'react';
import { Form } from 'react-bootstrap';

const Login = () => {

    const handleGoogleSIgnIn = () => {

    }
    return (
        <div className="container w-50 text-start">
            <Form>
                <Form.Group className="mb-3 d-flex  mx-auto" controlId="formBasicEmail" >
                    < Form.Label className="me-3" > Name</Form.Label >
                    <Form.Control type="email" placeholder="Your Name" />

                </Form.Group >

                <Form.Group className="mb-3 d-flex mx-auto" controlId="formBasicPassword">
                    <Form.Label className="me-3">Password</Form.Label>
                    <Form.Control type="password" placeholder="Password" />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicCheckbox">
                    <Form.Check type="checkbox" label="Check me out" />
                </Form.Group>
                <Button variant="primary" type="submit">
                    Login
                </Button>
                <Button onClick={handleGoogleSIgnIn} variant="primary" type="submit">
                    Login with Google
                </Button>
            </Form >
        </div >
    );
};

export default Login;
